import React, { Component } from 'react';
import './App.css';
import Button from './components/button';
import Table from './components/table';

const data = [
  {"PLAYER_NAME":"Lebron James", "SCORES":1332}
  ];
class App extends Component {
  render() {
    return (
      <div className="text-center text-secondary">
        <h1 style={{marginBottom:'5%'}}>Welcome to the NBA Fantasy Ranking Calculator</h1> 
          <Button text='Official NBA Rules'></Button>
        <Table data={data}></Table>
      </div>
    );
  }
}

export default App;
